import React from 'react';

class Fish extends React.Component {
    render() {
        const [name, image, desc, price, status] = this.props.details;
        return (
            <li className="menu-fish">
                <img src={image} alt={name}></img>
                <h3 className="fish-name">
                    {name}</h3>
            </li>
        );
    }
}

export default Fish;
